# Look up settings based on freq_in, freq_out
sub clocks_get_settings ($$) {
  my ($freq_in,$freq_out) = @_;
  if (exists $settings_ratehash{$freq_in."_".$freq_out}) {
    return (0,@{$settings_ratehash{$freq_in."_".$freq_out}});
  }
    
  if (exists $rounded_mappings{$freq_out}) {
    $freq_out = $rounded_mappings{$freq_out};
  }
  
  if (exists $settings_ratehash{$freq_in."_".$freq_out}) {
    return (0,@{$settings_ratehash{$freq_in."_".$freq_out}});
  }
      
  return 1;
}

# Look up settings based on line rate, and ref divider (fixed clock only)
sub clocks_get_settings_cupll ($$) {
  my ($line_rate,$div) = @_;
  my $fin_fout = "622080000_$div";
  print("fin_fout = $fin_fout\n");  
  if (exists $settings_ratehash{$fin_fout}) {
    return (0,$fin_fout,@{$settings_ratehash{$fin_fout}});
  } else {
    return (1,$fin_fout);
  }
}

# Look up settings based on line rate, and ref divider (fixed clock only)
sub clocks_get_settings_lr ($$) {
  my ($line_rate,$div) = @_;
  my $fin_fout = $lr_div_hash{$line_rate."_".$div};
  if (exists $settings_ratehash{$fin_fout}) {
    return (0,$fin_fout,@{$settings_ratehash{$fin_fout}});
  } else {
    return (1,$fin_fout);
  }
}

